let add = false;
let x = typeof $ !== 'undefined' ? $('[name="cLevel"]')[0] : document.querySelector('[name="cLevel"]');
for (i = 0; i < x.options.length; i++) {
    if (x.options[i].text === "Level A1") {
        if(add) {
            x.options[i].selected = true;
        } else {
            x.options.selectedIndex = i;
        }
    }
}

